                                    legal_moves.push_back({score, move});
                                }
                                legal_moves.push_back({score, move});
                            }
                        }
                    }
                }
            }
        }
    }

    cerr << "LEGAL MOVES :" << legal_moves.size() << "\n";
    assert(legal_moves.size() > 0u);
    int idx = rand() % legal_moves.size();
    cout << legal_moves[idx].second << "\n";
}

